  return (
    <div>
      <div
        id="service"
        class="h-100 d-inline-flex flex-row align-items-center "
        id="grid"
      >
        <h3 class="badge  p-2 mx-3  " id="box-1">
          Flex item 1
        </h3>
        <h3 class="badge  p-2 mx-3 " id="box-2">
          Flex item 2
        </h3>
        <h3 class="badge  p-2 mx-3 " id="box-3">
          Flex item 3
        </h3>
      </div>
    </div>
  );
}
